import React, { Component } from "react";
import axios from "axios";

export default class TestNote extends Component {
  constructor(props) {
    super(props);

    //this.onChangeUsername = this.onChangeUsername.bind(this);
    this.onChangeTodoList = this.onChangeTodoList.bind(this);

    this.state = {
      username: "",
      todoList: "",
    };
  }

  onChangeUsername(e) {
    this.setState({
      username: e.target.value,
    });
    console.log(this.state.username);
  }

  onChangeTodoList(e) {
    this.setState({
      todoList: e.target.value,
    });
  }

  onSubmit(e) {
    e.preventDefault();

    const list = {
      username: this.state.username,
      todoList: this.state.todoList,
    };

    console.log(list);

    axios
      .post("http://localhost:5000/list/add", list)
      .then((res) => console.log(res.data));
  }

  render() {
    return (
      <div className="container">
        <form>
          <label>Username: </label>
          <input
            type="text"
            required
            value={this.state.username}
            onChange={this.onChangeUsername}
          />
          <label>TodoList: </label>
          <input
            type="text"
            value={this.state.todoList}
            onChange={this.onChangeTodoList}
          />
          <input type="submit" value="Add This List" onClick={this.onSubmit} />
        </form>
      </div>
    );
  }
}
